import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import PhotoIcon from '@material-ui/icons/Photo';

import './../style/ImageUpload.css';

export default () => {
    const squidward =
        'https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg';
    const car = 'https://www.digitalartsonline.co.uk/cmsdata/features/3663941/3d-social.jpg';
    const sconic = 'https://www.renderhub.com/lykomodels/sonic-3d-model/sonic-3d-model-01.jpg';
    const bunny =
        'https://assets.flatpyramid.com/wp-content/uploads/2018/06/30111623/rabbit-model-for-3d-print-3d-model-279402.jpg';

    const images = [squidward, car, sconic, bunny];

    function image(i) {
        if (i <= images.length - 1) {
            return (
                <div className=''>
                    <img src={images[i]} alt='upload' className='image' />
                </div>
            );
        } else {
            return (
                <div className='image-placeholder'>
                    <PhotoIcon className='image-icon' fontSize='large' />
                </div>
            );
        }
    }
    return (
        <Container>
            <Row className='pb-2'>
                <Col>
                    {image(0)}
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(1)}
                </Col>
                <Col className='pl-2'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(2)}
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(3)}
                </Col>
                <Col className='pl-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(4)}
                </Col>
            </Row>
        </Container>
    );
};
